  `id_recibo` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `numero_recibo` int(11) NOT NULL,
  `fecha_recibo` datetime NOT NULL,
  `id_cliente` int(11) NOT NULL,
  `id_vendedor` int(11) NOT NULL,
  `condiciones` varchar(30) NOT NULL,
  `total_venta` varchar(20) NOT NULL,
  `estado_recibo` tinyint(1) NOT NULL,
  `kardex` varchar(100) NOT NULL,
  PRIMARY KEY (`id_recibo`),
  UNIQUE KEY `numero_cotizacion` (`numero_recibo`),
  UNIQUE KEY `id_recibo` (`id_recibo`)
) ENGINE=MyISAM AUTO_INCREMENT=53 DEFAULT CHARSET=utf8;

